BRILL(ブリル)は、粘度設定を自由にセッティングできるスノコ伝統のブレンド・コンセプト踏襲した最強のレーシングオイル。<br>
独自のエステル技術「ES-TECH(エステック)」を採用し可国なモータースポーツで結果を出すため、油圧の安定性、耐蒸発性、耐摩耗性を向上させました。<br>
<br>
長年のモータースポーツ活動から導き出された粘度。ノンポリマー仕様、ショートレンジにすることで油圧低下を抑制しました。<br>
「ES-TECH」により、タービン軸受けもしっかりと保護され、SUPER GTやスーパー耐久など多くのレースで実績のある粘度となっています。<br><center>

