用途：<br>
成分：化学合成油<br>
<br>
エンジン出力のみならず、エンジンレスポンスが重視されるサーキットにおけるスプリントレー ス等での走行を主眼においた製品で、ピックアップ性能の向上を一つのポイントとしています。特に高回転型のNA エンジンの主要要求性能の中でもフリクションロスを優先させる必要があり、高回転域における粘性抵抗の低減をコンセプトに開発された製品です。これらを可能にすべく、この製品は粘度温度特性に優れるハイドロカーボン系合成基油と、耐熱・溶解性に優れたエステル系合成基油を用い、更に摺動部分のせん断速度に対する柔軟な粘度追従を可能にする厳選された機能性ポリマーを使用し、更に複数のフリクションモディファイアーの組み合わせにより、粘性抵抗及び摩擦抵抗を最小限に抑え込むことを可能にした製品です。<br>
